import { Redirect } from "react-router";
import { useParams } from "react-router-dom";

const DeleteBlog = () => {
  const { id } = useParams();
  var url = "192.168.0.103/blog-delete/" + id;
  fetch(url).then((data) => {
    setIsPending(false);
    setData(data);
    setError(null);
  });
  return <Redirect to="/my-blog" />;
};

export default DeleteBlog;
